## Tooltip

The Tooltip component is a simple component that shows a message when the user hovers over an element.

```jsx
import React from 'react';
import PropTypes from 'prop-types';
import { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ children, message }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div
      onMouseEnter={() => setTooltip({ message, position: 'top' })}
      onMouseLeave={() => setTooltip(null)}
    >
      {children}
    </div>
  );
};

Tooltip.propTypes = {
  children: PropTypes.node.isRequired,
  message: PropTypes.string.isRequired,
};

export default Tooltip;
```

## TooltipContext

The TooltipContext is a React Context that holds the state of the currently open Tooltip.

```jsx
import React, { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ setTooltip }}>
      {children}
      {tooltip && (
        <div
          className="fixed top-0 left-0 w-full h-full z-50"
          onMouseEnter={() => setTooltip(tooltip)}
          onMouseLeave={() => setTooltip(null)}
        >
          <div
            className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 bg-gray-800 text-white p-2 rounded shadow"
            style={{
              maxWidth: '200px',
              whiteSpace: 'nowrap',
              textAlign: 'center',
            }}
          >
            {tooltip.message}
          </div>
        </div>
      )}
    </TooltipContext.Provider>
  );
};

export { TooltipContext, TooltipProvider };
```

## Usage

To use the Tooltip component, you need to wrap your application in the TooltipProvider component.

```jsx
import React from 'react';
import TooltipProvider from './TooltipProvider';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip message="Hello World">
          <button>Hover me</button>
        </Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

## Conclusion

In this article, we have learned how to create a Tooltip component in NextJS using React Context. The Tooltip component shows a message when the user hovers over an element, and the TooltipContext holds the state of the currently open Tooltip. By using the TooltipProvider component, we can wrap our application and use the Tooltip component in different places.

