You need to add an event listener to the headers, and change the `compare()` function to handle the different types of data.

```
const tbody = document.querySelector("tbody");
const headers = document.querySelectorAll("thead th");

for (const header of headers) {
  header.addEventListener("click", function() {
    const column = Array.from(tbody.rows).map(row => row.cells[this.cellIndex].innerText);
    column.sort(compare);
    for (let i = 0; i < tbody.rows.length; i++) {
      tbody.rows[i].cells[this.cellIndex].innerText = column[i];
    }
  });
}

function compare(a, b) {
  if (typeof a != "string") {
    a = a.toString();
  }
  if (typeof b != "string") {
    b = b.toString();
  }
  if (a < b) {
    return -1;
  } else if (a > b) {
    return 1;
  } else {
    return 0;
  }
}
