void loop() {
  // prompt the user to enter text
  Serial.println("Enter text to convert to Morse code:");
  String input = Serial.readString();

  // convert the input text to Morse code
  for (int i = 0; i < input.length(); i++) {
    char c = input.charAt(i);
    if (c >= 'A' && c <= 'Z') {
      c = c + 32; // convert to lowercase
    }
    if (c >= 'a' && c <= 'z') {
      int index = c - 'a';
      String morse = morseCode[index];
      outputMorseCode(morse);
    } else if (c == ' ') {
      delay(letterSpaceDuration);
    }
  }

  // add a final space between words
  delay(letterSpaceDuration);
}

void outputMorseCode(String morse) {
  for (int i = 0; i < morse.length(); i++) {
    char symbol = morse.charAt(i);
    if (symbol == '.') {
      tone(9, 1000, dotDuration);
      delay(dotDuration);
    } else if (symbol == '-') {
      tone(9, 1000, dashDuration);
      delay(dotDuration);
    }
    if (i < morse.length() - 1) {
      delay(dotDuration);
    }
  }
  delay(spaceDuration);
}
