            // Make the API request
            string apiUrl = $"https://api.steampowered.com/ISteamUser/GetPlayerBans/v1/?key=YOUR_API_KEY&steamids={steam64ID}";
            using (WebClient client = new WebClient())
            {
                string json = client.DownloadString(apiUrl);
                dynamic data = JsonConvert.DeserializeObject(json);

                // Print out the VAC ban information
                int vacBans = data.players[0].NumberOfVACBans;
                DateTime lastBanDate = DateTime.Parse((string)data.players[0].DaysSinceLastBan);
                Console.WriteLine($"Number of VAC bans: {vacBans}");
                Console.WriteLine($"Last VAC ban date: {lastBanDate}");
            }
        }
    }
}
